class Solution:
    def __init__(self):
        self.output = []
        self.operators = []
        self.precedence = {
            "-": 2,
            "+": 2,
            "/": 3,
            "*": 3,
        }

    def parse_int(self, chars: list, i: int) -> None:
        # given the starting index of an integer
        # pop all the digits off and replace the index with the full integer
        val = 0
        while chars and i < len(chars) and chars[i].isnumeric():
            val = val * 10 + int(chars.pop(i))
        chars.insert(i, val)

    def operate(self, operator: str):
        match operator:
            case "+":
                b = self.output.pop(-1)
                a = self.output.pop(-1)
                self.output.append(a + b)
            case "-":
                b = self.output.pop(-1)
                a = self.output.pop(-1)
                self.output.append(a - b)
            case "*":
                b = self.output.pop(-1)
                a = self.output.pop(-1)
                self.output.append(a * b)
            case "/":
                b = self.output.pop(-1)
                a = self.output.pop(-1)
                self.output.append(int(a / b))

    def calculate(self, s: str) -> int:
        self.output = []
        self.operators = []
        print(s)
        chars = list(s)
        if chars[0] == "-":
            chars.insert(0,"0")

        print(f"Input = {chars}")
        i = 0
        number = None
        while i < len(chars):
            char = chars[i]
            print(f"Token = {char} and output = {self.output} and operators = {self.operators} and number = {number}")
            if char.isnumeric():
                number = number * 10 + int(char) if number else int(char)
            elif char in self.precedence.keys():
                self.output.append(number)
                number = None

                while self.operators and self.precedence[self.operators[-1]] >= self.precedence[char]:
                    self.operate(self.operators.pop(-1))
                self.operators.append(char)
            i += 1
        if number is not None:
            self.output.append(number)

        while self.operators:
            self.operate(self.operators.pop(-1))

        return self.output[0]

